openapi: 3.0.1
info:
  title: Fleet Routing Engine
  description: |+
    Fleet Routing Engine is a set of APIs that will handle vehicle route scheduling. The API will return optimized route for each inputted vehicle.
    There are limitations on the payload that can be posted to the API, which are:
      1. The number of maximum jobs is 60.
      2. The number of unique end customer is 50.
      3. The number of vehicles in the fleet is 15.
  version: '0.1.0'
  x-additionalinfo: |+
    - This microservice consists of set of REST APIs to pre-process various data like customer, job data and travel matrix before the user can call the Fleet Routing Engine.
    - Tryitout by clicking the link here https://editor.swagger.io/?url=https://storage.googleapis.com/analytics_docs/fleet_routing_engine.yaml
  x-subscribelink: fleetroutingengine
  x-apitype: Subscription
  x-apitypedescription: |+
    Fast | Single-Call | 10MB/Call
  x-inputfilelimit: |+
    Process up to 10MB of data per API call.
  x-responsetime: |+
    Response rate is fast due to small data transfer per call made.
  x-billingmethod: |+
    The API is billed by per request.
  x-notes: |+

